import React from 'react'
import { Consumer } from '../../context'
import Card from './Card';

function Home() {
  return (
    <Consumer>
      {(value) => {
        const { mealtype } = value;
        return (
          <div className='container'>
            <div className="row">
              {mealtype && mealtype.map((item) => {
                return <Card item={item} />
              })
              }
            </div>
          </div>
        )
      }}
    </Consumer>
  )

}

export default Home
